@Solection 
"I don't know why people con girls raping boys "reverse rape". It's just rape in the end and should be labeled as rape."
It's because it's a specific subgenre of rape that people want a specific tag to describe. In order to find this with normal tags, you'd have to have the tag system to be thorough, to support namespaced tags, and to combine the following tags: "female:group "femdom" male:rape". Not all tagging systems are robust enough to handle this, and that kind of search that's dependent on multiple tags is awkward to employ. Much easier to have a single term to use.
